/** @jsx jsx */

import React, { Component } from 'react';
import { css, jsx } from '@emotion/core';
import { Link } from 'react-router-dom';

import Description from '../components/Description';
import Thumbnail from '../components/Thumbnail';
import Photo from '../assets/photos/DiegoFigueroa-MK.JPG'
import Article from '../components/Article'

const content = {
  header: "Resume + Contact",
  description: "Where you can find me:"
}

const resume = require('assets/files/MelissaKwanResume.pdf')

const articleStyle = css`
    div {
        font-size: 10em;
    }
    .Article >* {
        margin-bottom: 1em !important;
    }
`;

export default class PageResume extends Component {
  render() {
    return (
      <Article {...content}>
        <div css={resumeStyle}>
          Here's my <a target="_blank" href={resume}>Resume.</a>
          You can contact me by email <a target="_blank" href="mailto:mkwan@college.harvard.edu">(mkwan@college.harvard.edu)</a>
          <div><b>LinkedIn:</b> <a target="_blank" href="https://www.linkedin.com/in/melissa-kwan-147b13143/">Melissa Kwan</a></div>
          <div><b>Email:</b> <a target="_blank" href="mailto:mkwan@college.harvard.edu">mkwan@college.harvard.edu</a></div>
          <div><b>Resume:</b> <a target="_blank" href={resume}>2020 Resume</a></div>
        </div>
      </Article>
    );
  }
}
